import React, { Component } from 'react'

export default class ItemImage extends Component {
    render() {
        return (
            <div>
                {Object.keys(this.props.images).map((key)=>{
                    return <img src = {this.props.images[key]}></img>
                })
                }
            </div>
        )
    }
}
